import { Component } from 'react'

export default class MessageList extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <ul className="user-message-list">
                {this.props.messages.map((message, index) => {
                    return (
                        <li key={index}>
                            <div>
                                <span>{message.senderId}</span>
                                <p>{message.text}</p>
                            </div>
                        </li>
                    )
                })}
            </ul>
        )
    }
}
